// new game:
void new_game()
{
	clear_text(); // clears all text
	*LED = 0;
	player1 = 0;
    player2 = 0;
	game();
	if (player1 >= 2) {
		player1_win_game();
	}
	else if (player2 >= 2) {
		player2_win_game();		
	}
	audio_playback_mono(samples,34752); // horn blowing
	new_game();
}

// new round:
void game(void) 
{
	clear_text();
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;

    // Set random seed based on current time
    srand(time(NULL));

    // Set front pixel buffer to Buffer 1
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1;
    // Wait for VSYNC to swap buffers
    wait_for_vsync();
    // Initialize pixel buffer pointer
    pixel_buffer_start = *pixel_ctrl_ptr;

    // Draw start image
    draw_start_image();

    // Set back pixel buffer to Buffer 2
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    // Update pixel buffer pointer
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);
    // Draw start image on back buffer
    draw_start_image();

    volatile int *button = (int *)0xFF200050;
    volatile int *PS2_ptr = (int *)0xFF200100; // PS/2 port address

    unsigned char byte1 = 0;
    unsigned char byte2 = 0;
    unsigned char byte3 = 0;

    int PS2_data, RVALID;
    int prev_key_state = 0;
    int key_state = 0;

    // Wait for the PS/2 data to become valid and stable
    while (byte3 != 0x29 && (byte2 != 0xF0)) {
        PS2_data = *(PS2_ptr); // Read the Data register in the PS/2 port
        RVALID = (PS2_data & 0x8000); // Extract the RVALID field
        if (RVALID != 0) {
            // Save the last three bytes received
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
        }
        // Check for mouse insertion
        if ((byte2 == 0xAA) && (byte3 == 0x00)) {
            // Mouse inserted; initialize sending of data
            *(PS2_ptr) = 0xF4;
        }
        // Redraw start image
        draw_start_image();
        // Break loop if 'ESC' key (byte3 = 0x29) is pressed and released
    }
	//printf("Found space in title screen\n");
	
 
    int piece = 0;
    int old_key = byte3;
	int old_go = byte2;
	int piece_x = rand() % GRID_WIDTH;
    int piece_y = rand() % GRID_HEIGHT;
   /* int piece_x = GRID_WIDTH - 10;
    int piece_y = 0;*/
    int color = 0x0000;
	
	//int counter_b = 0;
	//int counter_w = 0;

    // Play 'enter' audio
    audio_playback_mono(enter, 22569); // bang sound
	byte3 = old_key;
	byte2 = old_go;
	
	//byte1 = byte2 = byte3 = 0;
	//old_key = 0;
	//old_go = 0;
	
	bool first_space_press = true;
	bool color_temp = false;
	
    while (piece < NUM_PIECES && !win1 && !win2) 
	{
        // Clear screen and draw grid
        clear_screen();
        draw_grid();
		red_screen();
        old_key = byte3;

        while(byte3 == old_key)
		{
			PS2_data = *(PS2_ptr); // Read the Data register in the PS/2 port
            RVALID = (PS2_data & 0x8000); // Extract the RVALID field
			if (RVALID != 0) 
			{
            // Save the last three bytes received
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
			//printf("Read data in main program: PS2_data = 0x%x\n", byte3);
            }
		}
        if ((byte2 == 0xAA) && (byte3 == 0x00)) 
		{
            // Mouse inserted; initialize sending of data
            *(PS2_ptr) = 0xF4;
        }
        //
        if (byte3 != old_key && (byte2 == 0xF0)) 
		{
			color_temp = false;
			help_message();
			clear_error_message();
			
            // Move piece based on key input plus other functions
			
            if (byte3 == 0x23) // [D]
			{
				if (piece_x < GRID_WIDTH) { // do color fading following piece in current location
					audio_playback_mono(woosh, 11136);
					place_piece(piece_x, piece_y, 0x4A69);
                	piece_x += 1; // Move the piece right by one
					
					/*if(color == 0x0000) {
						counter_b ++;
					}
					else if (color == 0xFFFF)
						counter_w ++;*/
				}
                if (piece_x >= GRID_WIDTH){
					audio_playback_mono(try_again, 12817);
					magenta_screen_bounds();
					error_message_bounds();
                    piece_x = piece_x -1;
				}
            } 
			else if (byte3 == 0x2D) // [R] to reset / restart game
			{ 
				clear_text();
				reset_grid();
				new_game();
			}
			else if (byte3 == 0x2C) // [T] to reset / restart round
			{ 
				clear_text();
				reset_grid();
				game();
			}
			else if (byte3 == 0x33) // [H] display the Help page
			{
				color_temp = true;
				clear_text();
				clear_screen_black(); 
				help_screen();
			}
			else if (byte3 == 0x5A) // [enter] return to game
			{ 
				clear_text();
				help_message();
			}
			else if (byte3 == 0x1C) // [A]
			{
				
				if (piece_x >= 0) // do color fading following piece in current location
				{ 
					audio_playback_mono(woosh, 11136);
					place_piece(piece_x, piece_y, 0x4A69);
                	piece_x -= 1; // Move piece left by 1
				}
                if (piece_x < 0)
				{
					audio_playback_mono(try_again, 12817);
					magenta_screen_bounds();
					error_message_bounds();
                    piece_x = piece_x +1;
				}
            } 
			else if (byte3 == 0x1B) // [S]
			{
				
				if (piece_y < GRID_HEIGHT)  // do color fading following piece in current location
				{
					audio_playback_mono(woosh, 11136);
					place_piece(piece_x, piece_y, 0x4A69);
                	piece_y += 1; // Move the piece down by one
				}
                if (piece_y >= GRID_HEIGHT)
				{
					audio_playback_mono(try_again, 12817);
					magenta_screen_bounds();
					error_message_bounds();
                    piece_y = piece_y -1;
				}
            } 
			else if (byte3 == 0x1D)  // [W]
			{
				
				if (piece_y >= 0) // do color fading following piece in current location
				{ 
					audio_playback_mono(woosh, 11136);
					place_piece(piece_x, piece_y, 0x4A69);
                	piece_y -= 1; // Move the piece up by one
				}
                if (piece_y < 0)
				{
					audio_playback_mono(try_again, 12817);
					magenta_screen_bounds();
					error_message_bounds();
                    piece_y = piece_y +1;
				}
            } 
			else if (byte3 == 0x29) // [spacebar]
			{
				if (first_space_press) // takes care of [space] pressed during start_page
				{
					first_space_press = false;
					continue; 
				}
				
                piece += 1;
				
                if (placedGrids[piece_x][piece_y] != true) // if place not occupied yet
				{
                   // place piece there:
                    audio_playback_mono(place, 22151);  // Play 'place' audio
					
					placedGrids_iswhite[piece_x][piece_y] = (color == 0xFFFF) ? true : false;
                    placedGrids[piece_x][piece_y] = true;
                    place_piece(piece_x, piece_y, color);
					
					win1 = check_win(0);
       				win2 = check_win(1);
					if (win1 || win2) {
						continue;
					}
					
					// get ready for new piece:
					color = (color == 0x0000) ? 0xFFFF : 0x0000; // Toggle color
					
					if (color == 0x0000) // if piece is black, play "player 1" audio
					{
						audio_playback_mono(player_one, 9659);
					}
					
					else if (color == 0xFFFF) // if piece is white, play "player 2" audio
					{
						audio_playback_mono(player_two, 10030);	
					}
					piece_x = rand() % GRID_WIDTH;
                	piece_y = rand() % GRID_HEIGHT;
					
					/*if( piece_x == ((sizeof(n) + sizeof(int) - 1) & ~(sizeof(int) - 1))  && piece_y == ) {
						piece_x = rand() % GRID_WIDTH;
                		piece_y = rand() % GRID_HEIGHT;
					}*/
					//bounds checking
					//((sizeof(n) + sizeof(int) - 1) & ~(sizeof(int) - 1))
					
                    // Reset piece position based on color
                   /* if (color == 0x0000) 
					{
                        piece_x = GRID_WIDTH - 10; // Start at center
                        piece_y = 0;
                    } 
					else if (color == 0xFFFF) 
					{
                        piece_x = 9; // Start at center
                        piece_y = 0;
                    }*/
                }
				else // if piece already there, play error sound
				{ 
					audio_playback_mono(try_again, 12817);
					magenta_screen_exist();
					error_message_exist();
				}
            }
			//old_key = byte3;
        }
        old_key = byte3;
		
        // Place piece if the position is not occupied (takes care of moving it around, not space)
		// also takes care of initial first black piece
        if (!placedGrids[piece_x][piece_y] && (!color_temp)) {
            place_piece(piece_x, piece_y, color);
        }

        // Swap front and back buffers on VGA vertical sync
        wait_for_vsync();

        if (pixel_buffer_start == (int)&Buffer1) {
            pixel_buffer_start = (int)&Buffer2;
            *(pixel_ctrl_ptr + 1) = (int)&Buffer2; // Set front buffer to Buffer2
        } else {
            pixel_buffer_start = (int)&Buffer1;
            *(pixel_ctrl_ptr + 1) = (int)&Buffer1; // Set front buffer to Buffer1
        }

        // Check for win condition
        win1 = check_win(0);
        win2 = check_win(1);
    }
	
	// when win:Change image to end_game when win detected
    wait_for_vsync();
	clear_text();
	clear_screen_black();
    // Play 'win' audio
    audio_playback_mono(win, 26122);
	
    // Reset placedGrids and placedGrids_iswhite arrays
	reset_grid();

    // Update player scores and LED status

	if(win1)
	{
		player1_win_round_pic(); 
		audio_playback_mono(player_one_wins, 25286);
		player1++;
		win1 = false;
		
		if(*LED == 0)
		{
			*LED=1;
		}
		else if (*LED == 0b1)
		{
			*LED = 0b11;
		}
		else if (*LED == 0b100000)
		{
			*LED = 0b100001;
		}
		else if (*LED == 0b100001)
		{
			*LED = 0b100011;
		}
	}
	else if(win2)
	{
		player2_win_round_pic();
		audio_playback_mono(player_two_wins, 25286);
		player2++;
		win2 = false;
		
		if(*LED == 0)
		{
			*LED= 0b100000;
		}
		else if (*LED == 0b100000)
		{
			*LED = 0b1100000;
		}
		else if (*LED == 0b1)
		{
			*LED = 0b100001;
		}
		else if (*LED == 0b100001)
		{
			*LED = 0b1100001;
		}
	}
	
	clear_text();
	
	if(player1 <2 && player2 <2)
	{
		game();
	}
}

void write_text(int x, int y, char * text_ptr)  // function to write text on screen (from Intel Doc)
{
	int offset; // 0xC9000000
	volatile char * character_buffer = (char *)0x09000000; // video character buffer
	/* assume that the text string fits on one line */
	offset = (y << 7) + x;
	while (*(text_ptr)) 
	{
		*(character_buffer + offset) = *(text_ptr); // write to the character buffer
		++text_ptr;
		++offset;
	}
}

void clear_text() // clears all text on screen
{
	int x,y;
	for(x = 0; x < 80; x++)
	{
		for(y = 0; y < 60; y++)
		{
			char clear[1] = " \0";
			write_text(x, y, clear);
		}
	}
}

