void plot_pixel(int x, int y, short int color) // plot pixels on screen
{
    volatile short int *one_pixel_address;
    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
    *one_pixel_address = color;
}

void clear_screen() // makes background grey
{ 
    int x, y;
    for (x = 0; x < SCREEN_WIDTH; ++x) {
        for (y = 0; y < SCREEN_HEIGHT; ++y) {
            plot_pixel(x, y, BACKGROUND_COLOR);
        }
    }
}

void draw_grid() {
    for (int i = 0; i < GRID_WIDTH; i++) {
        int x = i * GRID_SIZE;
        for (int j = 0; j < GRID_HEIGHT; j++) {
            int y = j * GRID_SIZE;

            // Draw vertical grid lines
            if (i < GRID_WIDTH) {
                for (int k = 0; k < GRID_SIZE; k++) {
                    plot_pixel(x+GRID_SIZE/2, y + k, LINE_COLOR); // plots dots on the intersections
					// plot_pixel(x, y + k, LINE_COLOR); // plots dots in the space
                }
            }

            // Draw horizontal grid lines
            if (j < GRID_HEIGHT) {
                for (int k = 0; k < GRID_SIZE; k++) {
                    plot_pixel(x + k, y+GRID_SIZE/2, LINE_COLOR); // plots dots on the intersections
					//plot_pixel(x + k, y, LINE_COLOR); // plots dots in the space
                }
            }

            // Draw pieces if placedGrids is true (after initial black piece placed)
            if (placedGrids[i][j]) {
                short int color = placedGrids_iswhite[i][j] ? 0xFFFF : 0x0000;
                place_piece(i, j, color);
            }
        }
    }
}

void place_piece(int x, int y, short int color) {
    // Calculate pixel coordinates from grid coordinates
    int center_x = (x * GRID_SIZE) + (GRID_SIZE / 2);
    int center_y = (y * GRID_SIZE) + (GRID_SIZE / 2);
    int radius = GRID_SIZE / 2;

    // Place a circular piece at the specified coordinates
    for (int i = 0; i < SCREEN_WIDTH; ++i) {
        for (int j = 0; j < SCREEN_HEIGHT; ++j) {
            int distance = (i - center_x) * (i - center_x) + (j - center_y) * (j - center_y);
            if (distance <= radius * radius) {
                plot_pixel(i, j, color);
            }
        }
    }
}

void wait_for_vsync() 
{
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    register int status;

    *pixel_ctrl_ptr = 1; // Start synchronization

    // Wait until synchronization is complete
    do {
        status = *(pixel_ctrl_ptr + 3);
    } while ((status & 0x01) != 0);

    return;
}

bool check_win(int color) 
{
    int consecutive_pieces;
    bool current = false;

    // Check vertically
    for (int x = 0; x < GRID_WIDTH; x++) {
        consecutive_pieces = 0;
        for (int y = 0; y < GRID_HEIGHT; y++) {
            if (placedGrids[x][y] && (placedGrids_iswhite[x][y] == (color))) {
                consecutive_pieces++;
                if (consecutive_pieces >= WIN) return true;
            } else {
                consecutive_pieces = 0;
            }
        }
    }

    // Check horizontally
    for (int y = 0; y < GRID_HEIGHT; y++) {
        consecutive_pieces = 0;
        for (int x = 0; x < GRID_WIDTH; x++) {
            if (placedGrids[x][y] && (placedGrids_iswhite[x][y] == (color))) {
                consecutive_pieces++;
                if (consecutive_pieces >= WIN) return true;
            } else {
                consecutive_pieces = 0;
            }
        }
    }

    // Check diagonally (top-left to bottom-right)
    for (int x = 0; x < GRID_WIDTH - 2; x++) {
        for (int y = 0; y < GRID_HEIGHT - 2; y++) {
            consecutive_pieces = 0;
            for (int i = 0; i < 3; i++) {
                if (placedGrids[x + i][y + i] && (placedGrids_iswhite[x + i][y + i] == (color))) {
                    consecutive_pieces++;
                    if (consecutive_pieces >= WIN) return true;
                } else {
                    consecutive_pieces = 0;
                    break;
                }
            }
        }
    }

    // Check diagonally (top-right to bottom-left)
    for (int x = 2; x < GRID_WIDTH; x++) {
        for (int y = 0; y < GRID_HEIGHT - 2; y++) {
            consecutive_pieces = 0;
            for (int i = 0; i < 3; i++) {
                if (placedGrids[x - i][y + i] && (placedGrids_iswhite[x - i][y + i] == (color))) {
                    consecutive_pieces++;
                    if (consecutive_pieces >= WIN) return true;
                } else {
                    consecutive_pieces = 0;
                    break;
                }
            }
        }
    }

    return false;
}

	
